import React from 'react';

const WeatherData = ({ list }) => {
  const handleClick = (event) => {
    console.log(event.target.value);
  };

  return (
    <div className="weather-data">
      <p>Here is the list of the current 7-day forecast:</p>
      {list.map((item) => (
        <div key={item.dt} className="weather-card">
          <button type="button" onClick={handleClick} value={item.main.temp}>
            Check my temperature
          </button>
          <p>Temperature: {item.main.temp} °F</p>
          <p>Humidity: {item.main.humidity}%</p>
          <p>Lowest Temperature: {item.main.temp_min} °F</p>
          <p>Highest Temperature: {item.main.temp_max} °F</p>
        </div>
      ))}
    </div>
  );
};

export default WeatherData;
